import express from "express";
import routes from "./routes/index.js";
import logger from "./middlewares/logger.js";
import getUsers from "./database/db.js";

const app = express();

console.log(getUsers);

app.use(express.json());
app.use(logger);
app.use("/api", routes);

export default app;

