import pkg from "pg";
import dotenv from "dotenv";

dotenv.config();
const { Pool } = pkg;

const pool = new Pool({
  user: process.env.DATA_BASE_USER,
  host: process.env.DATA_BASE_HOST,
  database: process.env.DATA_BASE_DATABASE,
  password: process.env.DATA_BASE_PASSWORD,
  port: Number(process.env.DATA_BASE_PORT),
  max: 20,
  idleTimeoutMillis: 30000,
  connectionTimeoutMillis: 2000,
});

/**
 * Retorna um objeto com status da conexão
 * { connected: boolean, message: string }
 */
async function getClient() {
  try {
    const client = await pool.connect();
    client.release(); // libera a conexão de volta para o pool
    return { connected: true, message: "Conectado ao banco com sucesso" };
  } catch (err) {
    return { connected: false, message: `Falha ao conectar: ${err.message}` };
  }
}

export { pool, getClient };

